function Menu({ Items, selectedItem })
{
    return (
        <ul>
            {
                Items.map(
                    (Item, index) => (
                        <li key={index} onClick={() => selectedItem.value=index}>
                            {Item.ItemNum}
                        </li>
                    )
                )
            }
        </ul>
    );
}

export default Menu;
